function appendAnswer(s){const e=$('\n<div class="match-answers-item">\n\t<span class="match-answers-item-id"></span>\n\t<span class="match-answers-item-quest"></span>\n\t<span class="match-answers-item-answer"></span>\n\t<span class="match-answers-item-score"></span>\n</div>');e.children(".match-answers-item-id:first").text(s.id),e.children(".match-answers-item-answer:first").text(s.answer),e.children(".match-answers-item-score:first").text(s.score);const t=e.children(".match-answers-item-quest:first");$.ajax({url:"/web/quest/search",type:"POST",data:{id:s.questid},success:function(s){if("ok"===s.status)return t.html(""),void s.data.quest.split("\n").forEach(s=>{t.append($("<p></p>").text(s))});console.log("res:",s)}}),$("#match-answers-box").append(e)}$(document).ready(function(){$.ajax({url:"/web/quest/match/check",type:"POST",data:{muserid:muserid},success:function(s){if("ok"===s.status){console.log("anss:",s.answers),$("#match-answers-box").html("");var e=0,t=0;return s.answers.forEach((s,a)=>{e+=1,t+=s.score,appendAnswer({id:a+1,questid:s.questid,answer:s.answer,score:s.score})}),void $("#match-info-score").text(t+"/"+e)}console.log("error res:",s)}}),$.ajax({url:"/web/user/info/"+userid+"/info",type:"GET",success:function(s){if("ok"===s.status){const e=s.data;$("#match-info-username").text(e.username)}}})});